webpackJsonp([73817125850167],{2688:function(e,o){e.exports={pathContext:{docHtml:'<p><img src="https://raw.github.com/hapijs/hoek/master/images/hoek.png" alt="hoek Logo"></p>\n<p>Utility methods for the hapi ecosystem. This module is not intended to solve every problem for everyone, but rather as a central place to store hapi-specific methods. If you\'re looking for a general purpose utility module, check out <a href="https://github.com/lodash/lodash">lodash</a> or <a href="https://github.com/jashkenas/underscore">underscore</a>.</p>\n<p><a href="http://travis-ci.org/hapijs/hoek"><img src="https://secure.travis-ci.org/hapijs/hoek.svg" alt="Build Status"></a></p>\n<p><a href="https://andyet.com"><img src="https://s3.amazonaws.com/static.andyet.com/images/%26yet-logo.svg" align="right"></a></p>\n<p>Lead Maintainer: <a href="https://github.com/nlf">Nathan LaFreniere</a></p>\n<p><strong>hoek</strong> is sponsored by <a href="https://andyet.com">&#x26;yet</a></p>\n<h2>Usage</h2>\n<p>The <em>Hoek</em> library contains some common functions used within the hapi ecosystem. It comes with useful methods for Arrays (clone, merge, applyToDefaults), Objects (removeKeys, copy), Asserting and more.</p>\n<p>For example, to use Hoek to set configuration with default options:</p>\n<pre><code class="language-javascript">const Hoek = require(\'hoek\');\n\nconst default = {url : "www.github.com", port : "8000", debug : true};\n\nconst config = Hoek.applyToDefaults(default, {port : "3000", admin : true});\n\n// In this case, config would be { url: \'www.github.com\', port: \'3000\', debug: true, admin: true }\n</code></pre>\n<h2>Documentation</h2>\n<p><a href="API.html"><strong>API Reference</strong></a></p>',docPath:"argo-ci/node_modules/hoek/readme",proj:"argo-ci"}}}});
